  // Close any other open edit sections first\r\n    closeAllEditModes();\r\n\r\n    editingProduct = productIndex;\r\n    const elReviewItem = document.querySelector(`${EL_REVIEW_ITEM}[data-product-index=\"${productIndex}\"]`);\r\n    const elOverlay = elReviewItem ? elReviewItem.querySelector(EL_EDIT_OVERLAY) : null;\r\n    const elEditButton = elReviewItem ? elReviewItem.querySelector(EL_EDIT_BUTTON) : null;\r\n    const elStepPanel = document.querySelector(`${EL_STEP_PANEL}[data-step=\"${productIndex}\"]`);\r\n\r\n    if (!elOverlay || !elStepPanel || !elEditButton) return;\r\n\r\n    // Preserve current selection before opening edit mode\r\n    const currentSelection = elStepPanel.querySelector('input[type=\"radio\"]:checked');\r\n    const currentSelectionValue = currentSelection ? currentSelection.value : null;\r\n\r\n    // Get product data from form (not step panel since we moved it)\r\n    const elForm = document.querySelector(EL_FORM);\r\n    const elProduct = elForm ? elForm.querySelector(`${EL_PRODUCT}[data-index=\"${productIndex}\"]`) : null;\r\n\r\n    if (!elProduct) {\r\n      return;\r\n    }\r\n\r\n    const { product } = elProduct.dataset;\r\n    const { variants, title } = JSON.parse(decodeURIComponent(product));\r\n\r\n    // Populate swatches\r\n    populateEditSwatches(productIndex, variants);\r\n\r\n    // Verify selection is still intact after opening edit mode\r\n    setTimeout(() => {\r\n      const verifySelection = elStepPanel.querySelector('input[type=\"radio\"]:checked');\r\n      if (currentSelectionValue && (!verifySelection || verifySelection.value !== currentSelectionValue)) {\r\n        // Restore selection if it was lost\r\n        const correctInput = elStepPanel.querySelector(`input[value=\"${currentSelectionValue}\"]`);\r\n        if (correctInput) {\r\n          correctInput.checked = true;\r\n        }\r\n      }\r\n    }, 10);\r\n\r\n    // Show edit section with animation\r\n    elOverlay.style.display = 'block';\r\n    elEditButton.classList.add('expanded');\r\n\r\n    // Change button text to SELECT and add select-mode class\r\n    const textEl = elEditButton.querySelector('.bundle-stepper__edit-button-text');\r\n    if (textEl) {\r\n      textEl.textContent = 'SELECT';\r\n      elEditButton.classList.add('select-mode');\r\n    }\r\n\r\n    // Update selected shade info with current selection\r\n    updateSelectedShadeInfo(productIndex - 1);\r\n  }\r\n\r\n  function closeAllEditModes() {\r\n    const elAllOverlays = document.querySelectorAll(EL_EDIT_OVERLAY);\r\n    const elAllEditButtons = document.querySelectorAll(EL_EDIT_BUTTON);\r\n\r\n    elAllOverlays.forEach((overlay) => {\r\n      overlay.style.display = 'none';\r\n    });\r\n\r\n    elAllEditButtons.forEach((button) => {\r\n      button.classList.remove('expanded');\r\n\r\n      // Reset button text to EDIT and remove select-mode class\r\n      const textEl = button.querySelector('.bundle-stepper__edit-button-text');\r\n      if (textEl) {\r\n        textEl.textContent = 'EDIT';\r\n        button.classList.remove('select-mode');\r\n      }\r\n    });\r\n\r\n    editingProduct = null;\r\n  }\r\n\r\n  function populateEditSwatches(productIndex, variants) {\r\n    const elReviewItem = document.querySelector(`${EL_REVIEW_ITEM}[data-product-index=\"${productIndex}\"]`);\r\n    const elSwatchContainer = elReviewItem ? elReviewItem.querySelector(EL_EDIT_SWATCHES) : null;\r\n    const elStepPanel = document.querySelector(`${EL_STEP_PANEL}[data-step=\"${productIndex}\"]`);\r\n\r\n    if (!elSwatchContainer || !elStepPanel) return;\r\n\r\n    // Clear existing swatches\r\n    elSwatchContainer.innerHTML = '';\r\n\r\n    // Get the original swatches from the step panel\r\n    const elOriginalSwatches = elStepPanel.querySelectorAll('.product__form-swatch');\r\n    const currentSelection = elStepPanel.querySelector('input[type=\"radio\"]:checked');\r\n\r\n    elOriginalSwatches.forEach((originalSwatch) => {\r\n      // Clone the original swatch\r\n      const clonedSwatch = originalSwatch.cloneNode(true);\r\n\r\n      // Get the input from the cloned swatch\r\n      const clonedInput = clonedSwatch.querySelector('input[type=\"radio\"]');\r\n      if (!clonedInput) return;\r\n\r\n      // Modify the cloned swatch for edit mode\r\n      clonedSwatch.classList.add('bundle-stepper__edit-swatch');\r\n\r\n      // Update the input ID and name to avoid conflicts with original form\r\n      const originalId = clonedInput.id;\r\n      const originalName = clonedInput.name;\r\n      const newId = `${originalId}-edit`;\r\n      const newName = `${originalName}-edit`;\r\n\r\n      clonedInput.id = newId;\r\n      clonedInput.name = newName; // This prevents radio conflicts with original form\r\n\r\n      // Update the label to point to the new input\r\n      const clonedLabel = clonedSwatch.querySelector('label');\r\n      if (clonedLabel) {\r\n        clonedLabel.setAttribute('for', newId);\r\n      }\r\n\r\n      // Mark as selected if it matches current selection\r\n      if (currentSelection && currentSelection.value === clonedInput.value) {\r\n        clonedSwatch.classList.add('selected');\r\n        clonedInput.checked = true;\r\n        updateSelectButton(productIndex, true);\r\n      } else {\r\n        clonedSwatch.classList.remove('selected');\r\n        clonedInput.checked = false;\r\n      }\r\n\r\n      // Add click handler to the cloned swatch\r\n      clonedSwatch.addEventListener('click', (e) => {\r\n        e.preventDefault();\r\n        e.stopPropagation(); // Prevent bubbling to form\r\n        selectEditSwatchOriginal(clonedSwatch, clonedInput, productIndex);\r\n      });\r\n\r\n      // Also add click handler to the input\r\n      clonedInput.addEventListener('click', (e) => {\r\n        e.preventDefault();\r\n        e.stopPropagation(); // Prevent bubbling to form\r\n        selectEditSwatchOriginal(clonedSwatch, clonedInput, productIndex);\r\n      });\r\n\r\n      // Prevent change